import React from "react";

function Dropdownmenu(props) {
  const pageNoArr = props.props;

  return (
    <>
      <div className="dropdown">
        {pageNoArr.map((elem) => (
          <div
            className="menu"
            onClick={(e) => {
              props.onShow(e, elem);
            }}
          >
            <div>{elem}</div>
          </div>
        ))}
      </div>
    </>
  );
}
export default Dropdownmenu;
